import React from 'react'

export default class Contact extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        error: null,
        isLoaded: false,
        students: []
      };
    }

    componentDidMount() {
        alert()
      fetch("http://dummy.restapiexample.com/api/v1/employees")
        .then(res => res.json())
        .then(
          (result) => {
            this.setState({
              isLoaded: true,
              students: result.items
            });
          },

          (error) => {
            this.setState({
              isLoaded: true,
              error
            });
          }
        )
    }

    render() {
      const { error, isLoaded, students } = this.state;
      if (error) {
        return <div>Error: {error.message}</div>;
      } else if (!isLoaded) {
        return <div>Loading...</div>;
      } else {
        return (
          <div className='container'> 
          <ul>               
            {students.map(item => (
              <li key={item.id}>
                {item.id} {item.employee_name}
              </li>
            ))}
          </ul>
          </div>
        );
      }
    }
  }
